import './App.css';
import Signup from './components/Signup';
import Login from './components/Login'
import Navigation from './components/Navigation';
import axios from 'axios';
import {useState, useEffect} from 'react'



function App() {

  useEffect(() => {
    axios.get('/me')
  }, [])


  return (
    <div className="App">
        <Navigation />
        <Signup />
        <Login />
    </div>
  );
}

export default App;
